import React from 'react'
import { Provider } from 'mobx-react'
import store from './store'
import Home from './pages/Home'

function App() {
  return (
    <div>
        <Provider store={store}>
            {
                store.todos.map((ele,index,arr)=>{
                    return(
                        <div key={index}>{ele}</div>
                    )
                })
            }
            <Home></Home>
        </Provider>
    </div>
  );
}

export default App;
